const items = $input.all(); // Get all input items
const handles = []; // To collect collection handles

// Extract from the first item (where metadata like email, petname, etc. are stored)
const firstItem = items[0]?.json || {};
const email = firstItem.email || '';
const petname = firstItem.petname || '';
const petKind = firstItem.petKind || '';
const sessionId = firstItem.session_id || '';
const customerName = firstItem.customer_name || '';
const phoneNumber = firstItem.phoneNumber || ''; // Extract phone number

// Loop through each item to extract collection handles
items.forEach(item => {
  if (item.json && item.json.custom_collection && item.json.custom_collection.handle) {
    handles.push(item.json.custom_collection.handle);
  }
});

// Join all collected handles into a comma-separated string
const collectionHandlesString = handles.join(',');

// Return a single output item with all requested fields
return [{
  json: {
    email,
    petname,
    petKind,
    sessionId,
    phoneNumber,
    customerName,
    collectionHandlesString
  }
}];

