// 1. Parse the new job data popped from Redis
const redisResult = $input.item.json.result;
const newJobData = JSON.parse(redisResult);

// 2. Retrieve the persistent infrastructure data (Slot ID) 
// form the very beginning of this workflow execution (P1's data)
const originalContext = $('Trigger From Ford').first().json;

return {
  json: {
    // Pass the raw result string so 01-Hagrid can parse it exactly as it expects
    result: redisResult,

    // PERSIST THE SLOT ID: The slot doesn't change, just the worker
    slot_id: originalContext.slot_id,

    // GENERATE NEW TOKEN: In your system, token seems to equal submission_id.
    // We must update this so the lock matches the new job.
    worker_token: newJobData.submission_id
  }
};

// 1. Get data from the Trigger (Source of Truth) and Format node
const triggerData = $('Trigger From Ford').first().json;
const formatData = $('Format Response').item.json;

// 2. Split Name
const fullName = triggerData.customer_name || 'Valued Customer';
const nameParts = fullName.trim().split(' ');
const firstName = nameParts[0];
const lastName = nameParts.slice(1).join(' ') || '';

// --- 3. CLEAN PHONE (THE FIX) ---
let rawPhone = formatData.phoneNumber || '';

// A. Remove spaces and dashes
let phone = rawPhone.toString().replace(/[\s-]/g, '');

// B. Check for Placeholders ("x") or invalid numbers
// If it contains 'x' (like +44 7xxx...) OR is too short to be real
if (phone.toLowerCase().includes('x') || phone.length < 5) {
    phone = ""; // Send empty string to Brevo (Brevo allows empty, but not duplicate x's)
}
// --------------------------------

// 4. Output Data mapped to your EXACT Brevo Attributes
return {
  json: {
    email: triggerData.email,
    FIRSTNAME: firstName,
    LASTNAME: lastName,
    SMS: phone,
    // Custom Attributes
    PET_NAME: triggerData.petname,
    PET_TYPE: triggerData.petKind,
    PET_GENDER: triggerData.petGender,
    PHONE_MODEL: triggerData.phoneModel
  }
};
